import React from 'react';
import styled from 'styled-components';
import { Title } from '../styled/theme';
const Main = styled.div`
    margin-top: 10vh;
    margin-bottom: 10vh;
    margin-left: 10vw;
	margin-right: 10vw;
	min-width: 100%;
	min-height: 100%;
	background-color: blue;
`;

const RecentImgs = () => {
	return(
		<Main className="main">
			<Title>Recent Stories</Title>
		</Main> 
	);
};

export default RecentImgs;
